import Carousel from 'styled-components-carousel';

import {Wrapper, Content, Image} from './ImageCarousel.styles'

export default function ImageCarousel({artists}) {

    return (
    <Wrapper>
        {artists && artists.length ? (
        <Content>
            <Carousel>
        {artists.map((artist, i) => (

          <div key={i} className="image_carousel_container">
              {artist.images[0] && (
                  <div className="carousel_image" style = {{
                    backgroundImage: `url(${artist.images[0].url})`
                  }} ></div>
              )}
          </div>

        ))}
        </Carousel>
        </Content>
        ) : <p>You don't like music?</p>}
    </Wrapper>


        )
    }
